// import img4 from './Growth_Activities.png';
// import img5 from './Max_air_quality.png';
// import img6 from './Min_air_quality.png';
// import img7 from './Temp_distribution.png';
import './Home.css'


const Logo = () =>{
	return(
		<div className = 'ma4 mt0' >
			<h1 className = 'f1 br2 shadow-2 black pa3 pointer center' style={{height: 100,width:500}}>Visualizations</h1>
			<Tilt className="Tilt br2 shadow-2 center" options={{ max : 55 }} style={{ height: 650, width: 600 }} >
 				<div className="Tilt-inner pa3">
 					<img style={{paddingTop: '10px', paddingBottom: '0px'}} alt='flag' src={img1}/>
 					<h3>Total Emission from all the Activities % throughout the Years</h3>
 				</div>
			</Tilt>
		</div>
	);
}

export default Logo
